-- Table structure for commodity
-- ----------------------------
DROP TABLE IF EXISTS `commodity`;
CREATE TABLE `commodity` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(64) DEFAULT NULL COMMENT '名称',
  `type` tinyint(1) DEFAULT '1' COMMENT '宝贝类型，1-淘宝 2-天猫',
  `icon` int(11) DEFAULT NULL COMMENT '图标',
  `images` varchar(1024) DEFAULT NULL COMMENT '图片',
  `price` decimal(8,2) DEFAULT NULL COMMENT '价格',
  `discount_price` decimal(8,2) DEFAULT NULL COMMENT '折后价',
  `sell_num` int(10) DEFAULT NULL COMMENT '销售数量',
  `category_id` int(11) DEFAULT NULL COMMENT '所属一级分类',
  `sub_category_id` int(11) DEFAULT NULL COMMENT '所属二级分类',
  `coupon_start_date` date DEFAULT NULL COMMENT '优惠券-开始时间',
  `coupon_end_date` date DEFAULT NULL COMMENT '优惠券-截至时间',
  `coupon_amount` decimal(8,2) unsigned DEFAULT NULL COMMENT '优惠券-金额',
  `coupon_url` varchar(512) DEFAULT NULL COMMENT '优惠券-跳转url',
  `summary` varchar(512) DEFAULT NULL COMMENT '简介-推荐理由',
  `content` text COMMENT '图文详情',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `today_recommended` tinyint(1) DEFAULT '0' COMMENT '是否今日推荐(改为进口优选)',
  `brand_seller_id` int(11) DEFAULT NULL COMMENT '商品所属品牌商家-已废弃',
  `module` tinyint(1) DEFAULT '0' COMMENT '模块 1-爱生活 2-品牌精选',
  `module_category_id` int(11) DEFAULT NULL COMMENT '模块下的分类',
  `need_buyed` tinyint(1) DEFAULT '0' COMMENT '是否必买清单',
  `enabled` tinyint(1) DEFAULT '1' COMMENT '0-下架1-上架',
  `item_id` varchar(60) DEFAULT NULL COMMENT '淘客商品id',
  `commision` decimal(9,2) DEFAULT NULL COMMENT '佣金',
  `free_ship` tinyint(1) DEFAULT '1' COMMENT '是否包邮',
  `tao_token` varchar(128) DEFAULT NULL COMMENT '淘口令',
  `out_icon` varchar(512) DEFAULT NULL COMMENT 'import-商品图标',
  `outer_images` varchar(1024) DEFAULT NULL COMMENT 'import-多图地址逗号分隔',
  `detail_url` varchar(512) DEFAULT NULL COMMENT 'import-商品详情页链接地址',
  `flag` tinyint(1) DEFAULT '0' COMMENT '0-手动新增 1-excel导入 2-自动采集',
  `handle_status` tinyint(1) DEFAULT '0' COMMENT '处理标识，配合flag = 1的时候使用，0-初始 1-已处理',
  `special_category_id` int(11) DEFAULT NULL COMMENT '特色分类id',
  PRIMARY KEY (`id`),
  UNIQUE KEY `item_id_unique_index` (`item_id`),
  KEY `category_id_index` (`category_id`),
  KEY `type_index` (`type`),
  KEY `name_index` (`name`),
  KEY `module_index` (`module`)
) ENGINE=InnoDB AUTO_INCREMENT=296647 DEFAULT CHARSET=utf8 COMMENT='商品表';

