-- Table structure for customer
-- ----------------------------
DROP TABLE IF EXISTS `customer`;
CREATE TABLE `customer` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `mobile` char(11) DEFAULT NULL COMMENT '手机号',
  `password` varchar(256) DEFAULT NULL COMMENT '密码',
  `nickname` varchar(32) DEFAULT NULL COMMENT '昵称',
  `gender` tinyint(1) DEFAULT '0' COMMENT '1-男 2-女 0-保密',
  `birthday` date DEFAULT NULL COMMENT '生日',
  `headpic` int(11) DEFAULT '0' COMMENT '头像-对应附件表id',
  `third_party_type` tinyint(1) DEFAULT '0' COMMENT '第三方登陆方式 1-微信 2-qq 3-支付宝',
  `third_party_uid` varchar(64) DEFAULT NULL COMMENT '第三方登陆id',
  `third_party_headpic` varchar(256) DEFAULT NULL COMMENT '第三方登陆头像',
  `recommend_qcode_path` int(11) DEFAULT '0' COMMENT '我的推荐二维码',
  `recommend_url` varchar(256) DEFAULT NULL COMMENT '我的推荐地址',
  `recommend_id` int(11) DEFAULT '0' COMMENT '我是被谁推荐的',
  `recommend_pid` int(11) DEFAULT '0' COMMENT '我的推荐人的推荐人id',
  `recommend_fid` int(1) DEFAULT '0' COMMENT '我的推荐的推荐人的推荐人的id',
  `enabled` tinyint(1) DEFAULT '1' COMMENT '是否可用-启用/禁用',
  `score` int(10) DEFAULT '0' COMMENT '用户积分',
  `mobile_code` varchar(40) DEFAULT NULL COMMENT '手机设备号-客户端',
  `recommend_code` varchar(32) DEFAULT NULL COMMENT '我的邀请码',
  `viped` tinyint(1) DEFAULT '0' COMMENT '是否是vip',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `ali_account` varchar(128) DEFAULT NULL COMMENT '支付宝账号',
  `wechat_account` varchar(128) DEFAULT NULL COMMENT '微信账号',
  `taobao_account` varchar(128) DEFAULT NULL COMMENT '淘宝账号',
  `taoke_pid` varchar(100) DEFAULT NULL COMMENT 'taoke_pid表的主键',
  `logged` tinyint(1) DEFAULT '0' COMMENT '是否登录过',
  `province_id` int(11) DEFAULT NULL COMMENT '号码归属省份',
  `city_id` int(11) DEFAULT NULL COMMENT '号码归属城市',
  `merchanted` tinyint(1) DEFAULT '0' COMMENT '是否是运营商',
  `proxy_type` tinyint(1) DEFAULT '0' COMMENT '代理商;;0-非代理商,1-市级代理商,2-省级代理商',
  `home_province` int(11) DEFAULT NULL,
  `home_city` int(11) DEFAULT NULL,
  `live_province` int(11) DEFAULT NULL,
  `live_city` int(11) DEFAULT NULL,
  `type` tinyint(1) DEFAULT '1',
  `merchant_mobile_code` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `recommend_code_unique` (`recommend_code`),
  UNIQUE KEY `taoke_pid_unique_indxe` (`taoke_pid`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='用户表';

